import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal by clicking on the cart icon/text
    // Try to find the cart by its visible text "Cart" inside a div
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal to appear by looking for the cart modal header
    await page.waitForSelector('text=Your cart', { timeout: 5000 }).catch(async () => {
      // If "Your cart" header is not present, look for a button with text "Proceed to Checkout" as fallback
      await page.waitForSelector('button.checkout-btn', { timeout: 5000 });
    });

    // Take screenshot after opening cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for any cart item to appear (using class "cart-item")
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Find the first cart item quantity span and its "+" button
    // Use nth selector for robustness
    const plusBtn = await page.$('.cart-item .quantity-btn:nth-of-type(2)');
    if (!plusBtn) {
      throw new Error('No "+" button found in cart item');
    }

    // Click the "+" button to increment quantity
    await plusBtn.click();

    // Wait for the quantity to update (wait for the quantity span to change)
    // Get the new quantity value for extraction
    const quantitySpan = await page.$('.cart-item .quantity');
    let newQuantity = null;
    if (quantitySpan) {
      await page.waitForTimeout(500); // Small pause for UI update
      newQuantity = await quantitySpan.textContent();
    }

    // Take screenshot after updating quantity
    const step3 = path.join(screenshotsDir, 'step_3_quantity_updated.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    return {
      success: true,
      action: "Opened cart and incremented the quantity of the first cart item",
      extractedData: {
        updatedQuantity: newQuantity ? newQuantity.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
